<?php
require_once 'public/dompdf-example/dompdf/autoload.inc.php';
use Dompdf\DomPdf;

class PdfPrinter{

    public function __construct()
    {
        
    }

    public function render($contenido, $fileName, $qr){

        $dompdf = new Dompdf();
        $numeroAlfanumerico = $contenido["codigoAlfanumerico"];
        $nombreCliente = $fileName;
        $numeroAsiento = $contenido["asiento"];
        $fechaSalida = $contenido["fechaSalida"];
        $fechaRegreso = $contenido["fechaRegreso"];
        $matricula = $contenido["matricula"];
        $tipoDeViaje = $contenido["tipoDeViaje"];
        $salida = $contenido["LugarSal"];
        $destino = $contenido["LugarDes"];
        $equipo = $contenido["equipo"];
        $modelo = $contenido["modelo"];
        $cabina = $contenido["cabina"];

        $qr = $qr->imprimirQr() ;
        


        $dompdf->loadHtml("<style>
        
        
        .contenedor{
        height:670px;
        width:100%; 
        opacity: 0.9;

        background-image:url('data:image/jpeg;base64,')

        background-size: 100%;
    }

    H1
        {
            text-align: center;
            color: #252440;
        }

    .informacion{
        background-color:rgb(226, 192, 192);
        width:60%;
        height: auto;
        margin-left:30px;
        border-radius:15px
    }
    li{
        font-size: 27px;
        margin-top:5px;
        color: #252440;
        background-color:beige;
        width:80%;
        font-family: 'Roboto', sans-serif;

    }

    p{
        font-size:30px;
        font-weight: bold;
        text-align:center;
        font-family: 'Roboto', sans-serif;

    }

    </style>
    <div class=contenedor>
    <div class='informacion'>
    <h1>Se ha registrado con exito su proximo viaje de Gaucho Rocket S.A</h1>

    <div>
    <div>
    <ul>
        <li>Nombre: $nombreCliente</li>
        <li>Salida: $fechaSalida desde $salida</li>
        <li>Llegada: $fechaRegreso en $destino </li>
        <li>Tipo de viaje: $tipoDeViaje</li>
        <li>Matricula de aernave: $matricula </li>
        <li>Cabina: $cabina</li>
        <li>Modelo: $modelo</li>
        <li>Asciento: $numeroAsiento</li>
        <li>Equipo: $equipo</li>
        <p>Codigo Alfanumerico: $numeroAlfanumerico<p>
        <li> $qr </li>

    </ul>
  
    </div>


    </div>
    </div>
    
    "



);
        $dompdf->setPaper('A4', 'landscape');
        $dompdf->render();
        $dompdf->stream($fileName, array("Attachment" => false));

    }

}
